import React from 'react'
import CardVertical from '../components/CardVertical'

const ListVertical = props => (
    <div>
        <ul>
            {
                props.store.image.map(item => (
                    <li>
                        <CardVertical image={item} title={props.store.text} />
                    </li>
                ))
            }
        </ul>
    </div>
)

export default ListVertical
